const CacheStore = require('./cacheStore')

class Apify extends CacheStore {

    constructor(config) {
        super(config, "APIFY")
    }

    setTypes(country, id, ids, names, stringId) {
        this.set(country + ":" + id, "SUPPLIER_IDS", JSON.stringify(ids))
        this.set(country + ":" + id, "NAMES", JSON.stringify(names))
        this.set(country + ":" + id, "STRING_ID", JSON.stringify(stringId))
    }

    getType(type, next) {
        this.getAll(type, next)
    }

}

module.exports = Apify
